-- Copy only unique rows where rider_name exists
INSERT INTO player_team_roster (team_id, rider_name, sex, year)
SELECT DISTINCT team_id, rider_name, sex, year
FROM player_team_roster_temp
WHERE EXISTS (
    SELECT 1 FROM rider
    WHERE rider.rider_name = player_team_roster_temp.rider_name
    AND rider.year = player_team_roster_temp.year
    AND rider.sex = player_team_roster_temp.sex
)
AND NOT EXISTS (
    SELECT 1 FROM player_team_roster
    WHERE player_team_roster.team_id = player_team_roster_temp.team_id
    AND player_team_roster.rider_name = player_team_roster_temp.rider_name
    AND player_team_roster.sex = player_team_roster_temp.sex
    AND player_team_roster.year = player_team_roster_temp.year
);

DROP TABLE player_team_roster_temp;

